import Layout from '../Components/Layout/Layout'

class Index extends Component{
	render(){
		return(
			<Layout>
			<h1 style = {{fontSize:'30px'}}> Chris Ortega </h1>
				<div className = 'container mt-5'>
					<div className = 'row'>
						<div className = 'col text-center'>
						<img src="/static/pp.jpg" alt="..." style= {{}} className="rounded-circle img-thumbnail"/>
						</div>
					</div>
				</div>
			</Layout>
		)
	}
}

export default Index;
